// function to check if a string of parentheses is balanced
function f_gold(s) {
    var q = []; // initialize an empty stack
    var parentheses = new Set(['()', '[]', '{}']); // define the valid pairs of parentheses
    for (var ch of s) { // iterate through each character in the string
        if ('([{'.indexOf(ch) >= 0) { // if the character is an opening parenthesis, push it onto the stack
            q.push(ch);
        }
        else if (q.length == 0 || !parentheses.has(q.pop() + ch)) { // if the character is a closing parenthesis, pop the top element from the stack and check if it forms a valid pair with the current character
            return false; // if not, return false
        }
    }
    return q.length == 0; // if the stack is empty, return true (all parentheses are balanced)
}
